import React from 'react';



export class Col extends React.Component{
    constructor(props){
        super(props);
    }

    render(){
        return(
            <div className="col-sm">
				<i className={"glyphicon " + this.props.gIcon}></i>
                {this.props.dataDisplay}
            </div>
        );
    }
}
export default Col;
